import React, { useEffect, useState } from 'react';
import axios from 'axios';

const VendorDashboard = () => {
  const [requests, setRequests] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8000/vendor-requests/').then(res => setRequests(res.data));
  }, []);

  return (
    <div>
      <h2>Sell Requests</h2>
      <ul>
        {requests.map(req => (
          <li key={req.id}>
            {req.crop} - {req.quantity}kg from {req.farmer_name} ({req.location}) ðŸ“ž {req.contact_number}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default VendorDashboard;
